import React from "react";
import { NavLink } from "react-router-dom";

const NotFound = () => {
    return (
        <div>
            <h3>404 , Page not Found</h3>
            <NavLink to = "/">Back to the HomePage</NavLink>
        </div>
    );
}

export default NotFound;
